(150, 1, 274, 3, 'points 5 6 and 7 .... ill be on work on them as soon as I resolve these issues with the sites name and SSL,<br /><br />As for the iStuff apps Ali is working on it, but it wont be here very soon.<br /><br />one reason for not extending scapes in the timelime is because as you can see, with your scape only, that scapes can get very very big and long, so it gets a bit unfeasable, what I can do is, depending on the length of the scape i can make it to extend on the same page.. or go to a new page, does that make sence?<br /><br />Or you think all scapes should extend in the timeline no matter what the size is?', '2010-09-26 18:50:54'),
