(184, 3, 285, 3, 'The thing is, I don''t want to offend potential users by just slapping ugly looking ads on the site. I want sexy-looking ads, placed in proper places.<br /><br />For instance, you will never see (in the future) an ad somewhere inside a scape. I want unspoiled content.', '2010-09-27 01:51:28'),
