(196, 1, 333, 3, 'After hours of thought and headakes we eventually came back to where we started and decided to call it <br /><br /><strong>"Deoscape"</strong><br /><br /><a href="http://www.deoscape.com" target="_blank">http://www.deoscape.com</a>  ---&gt; this it how it would look<br /><br />I asked alot of people .. I got about 13 to 14 votes, plus I also like it and friends are saying that its easy to remember.<br /><br />your opinion?', '2010-09-27 11:25:16'),
