(213, 1, 344, 3, 'Not MediaTemple, that thing has like 100s of down votes, we are currently on Hawkhost.<br /><br />its a vicious cycle ... Resources are needed to get users ... users are needed to make money ... money is needed to get the resources.<br /><br />Just need to get that right and we will be good to go, on a path to improvement.', '2010-09-28 14:48:32'),
(214, 1, 347, 3, 'HawkHost :) ... its nice, very nice ...', '2010-09-28 14:49:47'),
(216, 1, 344, 3, 'I was really thinking to like invest in another small server that wont really host a site and solely acts as a mail sending server, so what I was thinking was, I would send a GET request to that server with the info about the notifications and it gets stored in some sort of database or que, that que is mailed to the users using a cron job or something.<br /><br />My solutions are still quite vague, but I will figure something out soon, because its a major part of getting traffic.', '2010-09-28 14:57:08'),
