(221, 3, 358, 3, 'Since this is not your scape, you don''t get notified.', '2010-09-28 15:17:58'),
(222, 1, 358, 3, 'You are only getting notified when actions are made on your Items.<br /><br />I need some advice on this, I did not send notifs for every action done, cz that would be an overkill<br /><br />Instead what im thinking to do is.<br /><br />You mention the person on the comment like @akay and make the comment, then I get a notification that you commented.', '2010-09-28 15:19:19'),
(227, 1, 358, 3, 'Basically<strong> currently </strong>you get notifications on the things that you post, scapes you post, replies you post, photos you upload.<br /><br />The reason we considered this before is because a scape is very different from a post on the facebook wall, scapes get commented and replied to all year round... so overtime that would overkill the notification system.<br /><br />Im seeing that nowadays almost every one on facebook is useing the @ sign to refer the comment to a person... so I decided to make use of it.<br /><br />So later on when I make this feature addition, when you make a comment and you wish that I be notified about it, you need type @username anywhere in the comment.<br /><br />How is that?', '2010-09-28 15:25:44'),
