(193, 13, 143, 'Don''t be an IE hater!  It''s a work in progress, but I do prefer Chrome over IE.  Since a good chunk of the internet population does use IE and will continue to do so, this website should be compatible with it so people aren''t turned off by random formatting issues (first impressions do count!).  Good job on the website.  Now that I can navigate, I will give you more feedback tomorrow.<br /><br />By the way, can you guys come up with a name for this website that is easier to pronounce?  If it is pronounced the way it is written, then it''s too difficult to say it in a sentence more than once a year.  I will be calling it DeO from now on!<br /><br />Errr....why do the smiley faces always end up at the very end?  :@', '2010-09-24 21:38:26'),
