(156, 1, '<br /><a href="http://designoscape.com/" target="_blank"><img src="http://designoscape.com/graphics/en/no_transp/logo_header_wide.png" width="364" height="75" class="CGImage center" alt="logo_header_wide.png" /></a>	    <br /><img src="http://designoscape.com/graphics/en/imgs/DS_Banner.png" width="400" height="193" class="CGImage center" alt="DS_Banner.png" /><br />Hi! <br /><br />We''re very excited to announce our big project to the world. We invite you to come and be among the first to try our new website.<br /><br />DesignOscape is a tool that helps you find and share any kind of information with the people you want in a fun, easy, and organized way.<br /><br />First, you need to join DesignOscape! Once you join, you can also create your own profile.<br /><br />Here it is:<br /><a href="http://designoscape.com/" target="_blank">http://designoscape.com</a><br /><br />Hurry up and grab yourself a nice username!<br /><br />Thanks!<br />- <a href="http://designoscape.com/ali" target="_blank">Ali</a> and <a href="http://designoscape.com/akay" target="_blank">Abdullah</a>        ', 'For those who did not receive the email invitation -- Welcome!', '2010-09-25 08:59:47'),
