(216, 24, '@Ali<br />@Abdullah<br /><br />  Hey I know this is going to seem pretty stupid. Or maybe even defeating the purpose of creating a social network. But would using <a href="http://bar.meebo.com/" target="_blank">http://bar.meebo.com/</a> be of any help?<br /><br />I know in the end you''d probably want people to use ScapeHouse for messages and chat. But in the real world people use at least 5 services. <a href="http://bar.meebo.com/" target="_blank">http://bar.meebo.com/</a> allows them to use Gmail Chat, Facebook Chat, AIM, Twitter, and Meebo right from your site. I personally use Facebook Chat, Gmail and Yahoo at the same time so I know it would work for "me".<br /><br />They can also drag content to their friends and their friends are linked straight to ScapeHouse. Bam tell them they need to make an account. I don''t know but I see alot of sites using this toolbar.', '', '2010-09-28 14:32:52'),
