(231, 24, '@aLi<br />@AkAy<br /><br />Here is an idea. Don''t laugh. It may seem a little weird at first. But here goes.<br /><br />What if we were able to have web discussions? <img src="http://ecrp.uiuc.edu/figures/v8n2-birbili/images/webs.gif" width="330" height="300" class="CGImage center" alt="webs.gif" /><br /><br />Why we need it:<br /><br />Because often discussions break into more branches. This happens on Facebook and in forums. Currently if different discussions branch you have to click see more comments to be blown with 20 replies to one comment. Let''s be realistic. If this happens with more then 4 people it''s IMPOSSIBLE to follow the convo.<br /><br />Google uses it for cool searching. <img src="http://www.electricpig.co.uk/wp-content/uploads/2009/03/google-wonder-wheel-adds-spider-diagram-to-search1.jpg" width="300" height="300" class="CGImage center" alt="google-wonder-wheel-adds-spider-diagram-" /><br /><br />So why not use it for convo? Let the user choose to create a web convo or convert one if things become to hectic. <br /><br />For simplicity have the web going down only so you don''t defeat the purpose of making it easier to follow.', '@AKAY\n@ALI', '2010-09-28 16:14:53'),
