(300, 2, 'Today, we''re adding a much-wanted feature: Direct messaging, in the form of notes. <br /><br /><strong>Introducing Noteboard <br /><br /></strong>Starting today, all profiles will have a new tab called "Noteboard". Clicking this tab will bring up an actual note board, where you can leave notes for another user to read. You can also leave notes on your own board for your own reference, or for others to see.<br /><br /><strong><img class="CGImage center" src="http://sphotos.ak.fbcdn.net/hphotos-ak-snc4/hs027.snc4/33721_1626802116722_1436629308_1662819_7757944_n.jpg" width="255" height="300" alt="33721_1626802116722_1436629308_1662819_7" /><br /><br /></strong>Notes are intended to be short, and no more than 160 characters. Notes also come in different colors. You can choose your color just before you pin your note.<br />Once you pin a note on someone''s board, that person will be notified that you left them a note. <br /><br />We will be adding more features to Noteboard later on. We hope you enjoy using it! :)', 'Hey, did you get my note?', '2010-10-01 18:56:15'),
(301, 2, 'We''re also introducing jump lists. Jump lists appear when you briefly hover your mouse over the sidebar links. <br /><br /><img src="http://sphotos.ak.fbcdn.net/hphotos-ak-snc4/hs713.snc4/63350_1626852157973_1436629308_1662888_2559747_n.jpg" class="CGImage center" width="173" height="300" alt="63350_1626852157973_1436629308_1662888_2" /><br /><br />Jump lists should help you get around the site easier and faster. This feature should be available sometime tomorrow. <br /><br />Let us know what you think by leaving your reply below!', 'Oh and one more thing...', '2010-10-01 18:56:29'),
