(340, 1, '<a href="http://scapehouse.com/akay/watchlist/watching" target="_blank">http://scapehouse.com/akay/watchlist/watching</a><br /><br /> The idea is to invite more people,participate and get a few discussions, statuses, updates going.<br /><br />When the watch button is pressed for someone, you start getting updates of each and everything the person posts.<br /><br />Try it :)<br /><br />After that you can like or dislike that update, updates on Scapehouse are called "scapes" you can reply to it, and when you reply to it, other people can come and comment on your replies, heak they can even like and dislike what your reply :).<br /><br />Here is some more info on scapes and how they look: <a href="http://scapehouse.com/help/scapes" target="_blank">http://scapehouse.com/help/scapes</a> <br /><br />You can edit anything you post, from scapes to replies to comments, no need to delete and post again if you made a typo, just press the edit button under the comments or replies you made, for scape click the options menu on top of your scape to delete or edit it.<br /><br />Also check out the "Noteboard" its a tab in every persons profile, you can leave your friends a note and they will get notified about it, think of it like a mini Facebook wall.<br /><br /><img src="http://scapehouse.com/graphics/en/imgs/help/noteboard.png" class="CGImage center" width="255" height="300" title="The Noteboard" alt="noteboard.png" />', 'Here is a list of people you guys can start off with, press the "Watch" button, then check home page', '2010-10-03 15:40:23'),
