INSERT INTO `scape` (`id`, `userid`, `content`, `title`, `time`) VALUES
(412, 1, '<sup><em>This post is more than a year old,but it has some valuable information that I composed</em></sup><br /><br />The greatest limitation that production artist face is governed by computing power, in the world of productions a single frame of animation can take hours to render and it eventually becomes a must for the user to upgrade to get their work done faster.<br /><br />The thing to note here is that fast workstations don’t come cheap which is why I took the time out to talk about some ways to get the fastest speeds for the lowest price’s, now before I get too far into talking about this, I would like to point out that I am mainly aiming this to intermediate users who have a basic understanding of the inner workings of a computer, otherwise what I am trying to explain might go right over your head in addition to that I am only talking about the computer its self the price estimates I will give are only that of the computer , monitors and other things are excluded.<br /><br />So before doing anything you have to analyze what your requirements are, this is indeed a very important step that many people don’t give attention to and later end up disappointed with their machine, as I was saying you first zero in on what you want and for that you have to look at what sort of work you are doing because if you specialize in one sort of job your requirements may vary greatly.<br /><br /><strong><strong>3D Modelers</strong>:</strong><br /><br />Coming to the point, everyone who only uses their applications for jobs such as 3D modeling and by modeling I mean multimillion polygon models, mainly more RAM and a fast GPU is required, because heavy models cost a lot of RAM to view in real time and in turn a fast GPU is needed to render it in the viewports, as for the CPU, priority should be given to less cores with more speed.<br /><br /><strong>3D Animators:</strong><br /><br />If you are working on 3D animations the requirements are a bit different, the point here to note is that as long as your animation is still the GPU is utilized but as soon as you hit play your CPU is used, in order to maintain fluid playback, again a low core but high speed CPU is preferred. By core I am referring to the number of cores in products such as Core 2 Solo, Core 2 Duo, Core 2 Quad.<br /><br /><strong>Rendering:</strong><br /><br />If you are doing jobs related to rendering and specifically 3D rendering or any type of simulation such a job that takes up a lot of CPU power and a lot of RAM and depending on what you are rendering or simulating you may or may not need a ton of Hard Drive storage, programs such as RealFlow and FumeFX take up a lot of HDD space and can peak over 100s of GBs, but in this case the GPU is not used and priority is given to a CPU with more cores and high total parallel processing power and off course lots of RAM, GPU is low priority since it''s not used in final rendering.<br /><br /><strong>Video Editors and Compositors:</strong><br /><br />The preferred setup in this case would be low core high speed CPU and again a lot of RAM the GPU can be low priority as cheaper ones get the job done more or less without any trouble.<br /><br /><strong>My recommendations as of 2009:</strong><br /><br />You can get really good workstations for under US$500, back in 2007 Intel released a mind blowing quad core processor the Q6600 which is still running strong, after which Intel released an entire line of 45nm processors and then an entirely new processor labeled i7, but the thing is that all those that came after Q66 only give an improvement of a few seconds in terms of rendering time, so I would say if you are on a budget and need raw rendering power, pickup a Core 2 Quad probably something like a Q8200 45nm chip.<br />If you are an advanced user, an awesome way to save lots of money is by overclocking, all of Intel''s CPUs are made in a way that the fastest one on the product line is reduced in clock speed and is sold for a lower price, so basically if you overclock properly, you are paying for the lowest one on the line and enjoying the speed of the fastest one, and some chips even run stable at speeds faster than the top model, and with the new and improved architecture it means that you can over clock more and still get low temperature.<br />RAM is now cheaper than ever, I would say stuff your system as much RAM as you can but be aware that anything more than 3GBs will not be detected by 32-Bit operating systems or 32-Bit applications, to utilize anything over 3.5GBs you need a 64-Bit operating system as well as a 64-Bit version of your application.<br /><br /><strong>Conclusion</strong><br /><br /><strong>Here are some things to remember:</strong><br /><br />\n<ul>\n<li>Your GPU is only used inside the viewports of your application; they have no role in the actual final rendering or any simulation that you may conduct so buy one according to what you are doing.\n\n\n\n</li>\n<li>Your CPU is the most important component, but since most applications work on a single thread, that is, they only use 1 core out of the 2 , 4 or 8 that you may have, it is important to balance your core and GHz ratio depending on your needs, but at the end of the day a good quad core CPU will do you more good than a dual core in terms of speed and price, as support for quad core and octo core CPUs is rising.\n\n\n\n</li>\n<li>RAM can become the greatest limitation so get lots of it!\n\n\n\n</li>\n<li>Hard disks are only important if you are going to be simulating large contents of data like particle systems or fluid simulations.\n\n\n\n</li>\n</ul>--Abdullah', 'Affordable workstation for production | June, 2009', '2010-10-04 19:44:25'),
(413, 1, '<strong><a href="http://www.pixologic.com/home.php" target="_blank"><img src="http://upload.wikimedia.org/wikipedia/zh/5/56/ZbrushLogo.gif" class="CGImage center" title="Zbrush" alt="ZbrushLogo.gif" /><br /></a></strong><br />Zbrush a breakthrough indeed, developed by Pixologic it is a must have tool for any digital artist. Zbrush deals with 3D in a totally different perspective and is primarily used as a sculpting software application that allows artist to add mind-blowing amounts of detail to their models. <br /><img src="http://www.trinity3d.com/media/digital_tutors/sculpting_in_zbrush_3/sculpting_in_zbrush_3-1.jpg" width="283" height="251" class="CGImage center" alt="sculpting_in_zbrush_3-1.jpg" /><br />ZBrush has a 2.5D environment it is not 2D and it is not 3D, it is based on <em>pixols, </em>a pixol is similar to a pixel but with the added property to depth, this amazing technology allows the software to handle models peaking at millions of polygons and still be able to give real time viewport feed back as the model is edited.<br /><a href="http://lh6.ggpht.com/_tqD6YA8Kl_A/Sidxzj8wzgI/AAAAAAAAACA/HmH_9F_cp0k/s1600-h/Bezerker%20Resize%5B8%5D.jpg" target="_blank"><img title="Bezerker render by AKay" src="http://lh4.ggpht.com/_tqD6YA8Kl_A/Sidx0ib-nhI/AAAAAAAAACE/KF2_D3bAlZM/Bezerker%20Resize_thumb%5B6%5D.jpg?imgmax=800" width="387" height="300" class="CGImage center" alt="Bezerker%20Resize_thumb%5B6%5D.jpg?imgma" /></a><br />The main limitation of that arises when using ZBrush is when you have edited your model and it''s time to take it to your 3D application for rendering, the meshes that are produced in ZBrush are so dense and heavy consisting of millions of polygons that the 3D application crashes 8 out of 10 times, to combat this limitation a technique called normal mapping is used, a map with all the depth and height information is calculated by ZBrush and spat out, the map can then be applied to a low res 3D model in the application and get a detail that was made it ZBrush without going through endless crashes.<br /><img src="http://www.trinity3d.com/media/pixologic/zbrush3/zbrush3_example1.jpg" width="191" height="149" class="CGImage center" alt="zbrush3_example1.jpg" /><img src="http://alternativeto.net/Upload/Screens/a7e01c24-8048-4ab2-87da-0810d9c66e43_2_full.jpg" class="CGImage center" width="400" height="289" alt="a7e01c24-8048-4ab2-87da-0810d9c66e43_2_f" /> <br />ZBrush is also used as a texturing application due to its powerful painting tool set, artist can texture their models in a way similar to coloring in a coloring book, ZBrush automatically makes a map for your model and that can be used for rendering later on.<br /><img src="http://img213.imageshack.us/img213/6579/rsmatcapsset2iq1.jpg" width="305" height="219" class="CGImage center" alt="rsmatcapsset2iq1.jpg" /><br />ZBrush has support for Wacom tablets and tablets from many other brands, if ZBrush is going to become a part of your workflow then I recommend that you use a tablet as it greatly increases the interactivity and productivity as it has support for pressure.<br />Overall ZBrush is an extremely powerful application with powerful painting and sculpting features, but at it end of the day it is even more fun to use and play around with and my personal favorites.<br /><br />--Abdullah', 'Zbrush From Pixologic -- Software review | June, 2009', '2010-10-04 19:47:58'),
(414, 1, 'Vue is an advanced, feature rich but easy to use environment creation software, capable of rendering extremely realistic scenes, the way Vue manages environments is indeed a breakthrough, if Vue did not exist then realistic environment creation would still be one of the impossibilities in the field of CGI.<br /><a href="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktMaTyVi6I/AAAAAAAAAEI/oZ23RVXe1DI/s1600-h/holografisk%5B3%5D.jpg" target="_blank"><img title="holografisk" src="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktMbPgyXEI/AAAAAAAAAEM/nCaUHYOkNNg/holografisk_thumb%5B1%5D.jpg?imgmax=800" width="378" height="223" class="CGImage center" alt="holografisk_thumb%5B1%5D.jpg?imgmax=800" /></a><br />The unique and efficient way that Vue manages environments is that they bring instancing into play, making it light on the RAM and increasing productivity, in fact this way is so powerful that Vue can render scenes over 50 billion polygons dense, Vue reduces the actual scene to an order of a few thousand polygons in the viewport and when you hit render it brings in the real meat and soul of the environment to life.<br /><a href="http://lh5.ggpht.com/_tqD6YA8Kl_A/SktMb7yiQOI/AAAAAAAAAEQ/QvRedZp8LgQ/s1600-h/Elba-Mattia_Sullini%5B3%5D.jpg" target="_blank"><img title="Elba-Mattia_Sullini" src="http://lh3.ggpht.com/_tqD6YA8Kl_A/SktMdcVChhI/AAAAAAAAAEU/xJgdP9AMO78/Elba-Mattia_Sullini_thumb%5B1%5D.jpg?imgmax=800" width="377" height="222" class="CGImage center" alt="Elba-Mattia_Sullini_thumb%5B1%5D.jpg?img" /></a><br /><img src="http://www.e-onsoftware.com/showcase/DayPictures/3455_sha.jpg" class="CGImage center" width="400" height="277" alt="3455_sha.jpg" /><br />Apart from polygons Vue has advanced in many other environmental effects such as volumetric and advanced light rendering, the water rendering that Vue is capable of is just beautiful, volumetric and spectral clouds add a ton of life to the scene and a lighting system that is aware of what time of day you are aiming the scene to be at, not to mention the extremely powerful Ecosystem feature that comes in Vue, that allows you to create very realistic, very dense and highly interactive foliage in your scene you can literally populate  forests with it.<br /><a href="http://lh3.ggpht.com/_tqD6YA8Kl_A/SktMdhzx9dI/AAAAAAAAAEY/fY7yHt3gUc4/s1600-h/logo_3dsmax60%5B2%5D.jpg" target="_blank"><img title="logo_3dsmax60" src="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktMeQsJXFI/AAAAAAAAAEc/JudP1FOK0s4/logo_3dsmax60_thumb.jpg?imgmax=800" width="64" height="66" class="CGImage left" align="left" alt="logo_3dsmax60_thumb.jpg?imgmax=800" /></a> <a href="http://lh3.ggpht.com/_tqD6YA8Kl_A/SktMezlIHUI/AAAAAAAAAEg/eEgWIlmmYo4/s1600-h/logo_cinema4d60%5B5%5D.jpg" target="_blank"><img title="logo_cinema4d60" src="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktMftoYrtI/AAAAAAAAAEk/U7QLmC-Jvtw/logo_cinema4d60_thumb%5B1%5D.jpg?imgmax=800" width="64" height="66" class="CGImage left" align="left" alt="logo_cinema4d60_thumb%5B1%5D.jpg?imgmax=" /></a> <a href="http://lh5.ggpht.com/_tqD6YA8Kl_A/SktMgDltqhI/AAAAAAAAAEo/_BLUhTftXSk/s1600-h/logo_lightwave60%5B5%5D.jpg" target="_blank"><img title="logo_lightwave60" src="http://lh3.ggpht.com/_tqD6YA8Kl_A/SktMgg9du-I/AAAAAAAAAEs/SuNqFWJyGNA/logo_lightwave60_thumb%5B1%5D.jpg?imgmax=800" width="64" height="66" class="CGImage left" align="left" alt="logo_lightwave60_thumb%5B1%5D.jpg?imgmax" /></a> <a href="http://lh3.ggpht.com/_tqD6YA8Kl_A/SktMhCY3TmI/AAAAAAAAAEw/aBU32vRZlkQ/s1600-h/logo_maya60%5B2%5D.jpg" target="_blank"><img title="logo_maya60" src="http://lh3.ggpht.com/_tqD6YA8Kl_A/SktMhrv9KjI/AAAAAAAAAE0/ufVSksnoZxg/logo_maya60_thumb.jpg?imgmax=800" width="64" height="66" class="CGImage left" align="left" alt="logo_maya60_thumb.jpg?imgmax=800" /></a><a href="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktMiJhmmXI/AAAAAAAAAE4/3fb_la-WZPY/s1600-h/logo_xsi60%5B2%5D.jpg" target="_blank"><br /></a> <br /><br /><br /><br /><br /><br />Coming to the integration with your favorite 3D application, as of Vue 7 the integration of Vue in conjunction with 3dsmax and Maya has been improved dramatically and has actually become a lot more fun and productive to use, indeed a great upgrade from Vue 6, the integration that Vue 6 had or at least what they called it, was a good way to increase your stress, give you a headache and make your work slower and more painful all at wonderful price of over a 1000 bucks, since that is not the case anymore and Vue integrates into your workflow better than any other software out there, it now acts like a plug-in inside your application giving you all the creation tools without ever leaving the comfort of the native 3D application while at the same time utilizing Vue’s mind blowing rendering system.<br /><br /><br />Once Vue’s world in integrated with the scene in your 3D application the results can be amazing, Vue uses the Mental Ray rendering engine that comes in Autodesk’s 3D applications, you can control and use lighting and shaders from your application as well as Vue and the best part is that you can populate forests and paint foliage using Vue’s Ecosystem without crashing your system, as the use of Ecosystem''s can lead to a scene as heavy as 10 billion or more polygons, all that can be rendered on a modest system so you won''t go bankrupt buying massive servers to get small jobs done.<br /><img src="http://www.e-onsoftware.com/showcase/DayPictures/3454_sha.jpg" width="339" height="230" class="CGImage center" alt="3454_sha.jpg" /><br />Vue is indeed a very powerful piece of software and one can’t disagree that it is in fact a breakthrough in the field of CGI.<br /><br />--Abdullah', 'e-on software , Vue 7 -- Software review | June, 2009', '2010-10-04 19:54:16'),
(415, 1, 'Some common questions that arise in the minds of almost every beginner looking to make a career in production:<br /><br />Where should I start? What application to use? And most importantly, what application is the best?<br /><br />Now as anyone who has experience in the fields of software and design would say, "There is no one answer to these questions" but what I will help you guys do is to zero in on what suits you guys the best by analyzing your requirements one by one.<br /><br />First and foremost I would like to clarify for you people what I mean by "Production", in the film and entertainment industry a production means the compilation of all the digital content and CGI (computer generated imagery) into a final product, what that product will be is totally up to you, that is if you are working on your own, otherwise such decisions are made by the director of the production studio but as long as that is not the case your are the director , the producer , you have full control over what you want to create and how you want to create.<br /><br />Coming to the question of "where to start?” Now to answer this you have to ask yourself a few quick questions, what section of the production pipeline are you aiming to make your career in, here are a few steps of the pipeline:<br /><br />· 3D Modeling<br />· 3D Animation<br />· 2D Animation<br />· Compositing<br />· Visual effects<br />· Video editing<br />· Rendering<br /><br />This is a very rough sketch of the processes included in production but seeing this you can slim down the production process into 2 parts 3D and 2D , there are many more fields and sub fields that one can specialize in but for now this should get you going, I for one started out as a 3D Modeler and then over time I came across different programs, now if you are into the video editing and compositing side you will not have to deal with 3D at least not as much because in such a case all the video is shot from a real camera or is coming from the guys working in the 3D department , in any case the video is imported into software for refining, that is where you come in as a video editor, compositor or visual effects artist your job will be to add all the sauce and spices to the video, fix any issues and then render the final production.<br /><br />As for a person in the 3D side of production, his job is to model, texture, animate and render and send the raw rendered production to the compositors and video editors, depending on which sub field of 3D you wish to specialize in your jobs may be more or less.<br /><br />Coming to what application to use and which is better, this again varies from person to person, I personally prefer Autodesk and Adobe software for my work but there is so much out there in the market that a starter might find himself totally lost. For 3D we have countless software, 3ds Max, Maya, Cinema4D, LightWave, Hexagon, Modo, Blender, for 2D image and video editing and creation we have, Photoshop, Corel Draw, After Effects, Premiere, Sony Vegas, Combustion, Fusion , Digital Fusion and the list just goes on and on.<br /><br /><a href="http://4.bp.blogspot.com/_tqD6YA8Kl_A/SiX0vPsc1hI/AAAAAAAAABI/m9lna9swMkY/s1600-h/MAX+n+Maya.jpg" target="_blank"><img src="http://4.bp.blogspot.com/_tqD6YA8Kl_A/SiX0vPsc1hI/AAAAAAAAABI/m9lna9swMkY/s320/MAX+n+Maya.jpg" class="CGImage center" alt="MAX+n+Maya.jpg" /></a><br />Most people might say that Maya is better than 3ds Max, or After Effects is better than Digital Fusion and some might even say that if you want to go into the gaming industry you should chose 3dsmax and if you want to go in the Film industry you should chose Maya but let me tell you guys something even though 3ds Max is the most popular when it comes to gaming, at the end of the day you will find that both Maya and 3ds Max can achieve the same results in about the same time, this applies to all the other programs I have mentioned as well as the video editing software, it all goes down to what interface and layout suits you best, in some cases you might have to learn a software due to the requirements of the studio you are working in but once you have a solid hold on one software of its kind then the rest comes by its self, you will just have to familiarize yourself with the new buttons and procedures but it will not take you long to figure out everything because you will be aware how these things actually work under the hood.<br /><br />Content creation and production is an art in its self, very engaging, very interesting , and very rewarding, just the feeling of all your effort coming to life at render time is enough to keep you going on your path towards superiority in the field.<br /><a href="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktK6MACltI/AAAAAAAAAD4/PaYkcmbyaXA/s1600-h/battleship%20fire0063%5B3%5D.png" target="_blank"><img title="Battleship render by AKay" src="http://lh6.ggpht.com/_tqD6YA8Kl_A/SktK7fJlKXI/AAAAAAAAAD8/U5f_U8N3Lp8/battleship%20fire0063_thumb%5B1%5D.png?imgmax=800" width="389" height="226" class="CGImage center" alt="battleship%20fire0063_thumb%5B1%5D.png?i" /></a><br /><br />--Abdullah', 'New to the world of production?', '2010-10-04 20:00:02'),
(416, 1, '<strong>What is Autodesk 3ds Max? </strong><br /><br /><img src="http://ageofcreation3d.com/web_images/3ds-max-logo.jpg" class="CGImage center" width="318" height="300" alt="3ds-max-logo.jpg" /><br />3D Studio Max, 3ds Max or Max for short is a high end top of the line, industry standard 3D Production package developed by Autodesk with a full featured tool set offering you whatever you could possibly need for making amazing CGI, visualizations and animations.<br /><img src="http://1.bp.blogspot.com/_tqD6YA8Kl_A/SiU3tH51cJI/AAAAAAAAAA4/JZisPGIQhVA/s320/autodesk-3ds-max-2009.jpg" width="234" height="300" class="CGImage center" alt="autodesk-3ds-max-2009.jpg" /><br /><br />3ds Max is one of the most popular and most widely used 3D production packages used in the media industry, gaming industry, construction and architecture, visualizations and much more, ranging from top selling games to blockbuster movies. <br /><br />The beauty of 3ds Max is that it allows you to create very appealing content and very rewarding renders with just a little bit of experience with the software which all goes down to its streamlined easy to manage and highly organized and customizable interface. <br /><br />3ds Max provides its users that very edge of control and power over their creations without, sucking the fun out of it, and without making the process complex and tedious thanks to its brilliant interface.<br /><br /><a href="http://iskills.files.wordpress.com/2008/07/2009-3ds.jpg" target="_blank"><img src="http://iskills.files.wordpress.com/2008/07/2009-3ds.jpg" width="388" height="300" class="CGImage center" alt="2009-3ds.jpg" /></a><br />Max has come a long way since its release back in 1990, with 12 releases from 1990 to 2009, Max is now more powerful and versatile than ever before now available in 2 version 32-bits which is limited to 4GBs of RAM and 64-bits allowing users to fully utilize their RAM and is expandable from 4GBs onwards, out of the box it offers 2 renderers, Max''s Default Scanline renderer and the high-end Mental Ray renderer (Discreet 3ds Max 6 and later) which is capable of expandability to up to unlimited processing cores, it offers advanced and powerful modeling tools for polygonal, NURBS, spline modeling. It has a very powerful rigging and animation system called Character Studio, and a highly capable physics simulator called Reactor, Max also offers users a particle system called PFlow or Particle Flow which is widely used in making mind blowing visual effects.<br /><br />If you ever feel limited by Max''s tool set and features, Max''s offers its users access to MAXScript the software''s own programming language that allows you to fiddle with the under-the-hood components of the software, allowing you to make your own tools, loops, algorithms, particle systems, the possibilities with MAXScript are practically endless the only limit is your imagination and creativity. <br /><br />And even if that is not enough to fulfill your production needs the market is full of low profile to high-end plug-ins that either work within Max''s interface or as an external program, some of the most popular ones are from Sitni Sati, they offer an advanced fluid simulator called FumeFX, and a widely used visual effects plug-in called AfterBurn which is used to make realistic explosions.<br />For further details on the software visit <a href="http://usa.autodesk.com/adsk/servlet/index?id=5659302&amp;siteID=123112" target="_blank">Autodesk''s website</a><br /><br />--Abdullah', 'My productions application of choice -- Software review | June, 2009', '2010-10-04 20:05:58'),
