(777, 1, 'I am really bored looking at the current timeline we have at the home page, we need more richness in it.<br /><br />Not every one publishes scapes and if they don''t there is just nothing going on to check out.<br /><br />I am looking forward to build new features like the Scapebox (tagging) etc but I feel its more important to make the core of the site more interactive and rich than adding more stuff that you can do to scapes, when the main thing is majority of the people are not publishing scapes.<br /><br />But what I have noticed is that they do at the very least reply/comment/like/dislike and watch other people<br /><br />Keeping in mind our current technical limitations <strong>(no chat please :) )</strong> here are some things I thought of, that could add richness to the homepage.<br /><br />\n<ul>\n<li>Show the a list of the new people getting watched by the people you watch, every now and then.\n\n\n\n\n\n\n</li>\n<li>Some way to bring up scapes that are getting a lot of attention, alot of likes/dislikes or replies.\n\n\n\n\n\n\n\n</li>\n<li>Add a "ReScape" or "Share" option to share an interesting scape with your watchers, even if you your self have nothing to publish, lets say you want to share a homework scape.\n\n\n\n\n</li>\n<li>An entry for change of profile pictures, lets say one of the people I watch changed their profile picture, like uploaded a new one, me and all the other people watching him will get informed of this with a timeline entry, although I am not sure if thats going to screw up privacy for some people because a lot of people can watch you.\n\n\n\n\n\n</li>\n</ul>A tagged scape in the Scapebox or timeline:<br /><br /><a href="http://lh4.ggpht.com/_nzEKD59ZlMs/TLSWcrvVdmI/AAAAAAAAACk/zcwBYa_ULA4/Screen%20shot%202010-10-08%20at%209.09.40%20AM.png" target="_blank"><img src="http://lh4.ggpht.com/_nzEKD59ZlMs/TLSWcrvVdmI/AAAAAAAAACk/zcwBYa_ULA4/Screen%20shot%202010-10-08%20at%209.09.40%20AM.png" width="400" height="268" class="CGImage center" alt="Screen%20shot%202010-10-08%20at%209.09.4" /></a><br /><br />People being watched by the person you are watching:<br /><br /><a href="http://lh6.ggpht.com/_nzEKD59ZlMs/TLSWcqWrnJI/AAAAAAAAACg/Io1yI58ZC_4/Screen%20shot%202010-10-05%20at%205.23.29%20PM.png" target="_blank"><img src="http://lh6.ggpht.com/_nzEKD59ZlMs/TLSWcqWrnJI/AAAAAAAAACg/Io1yI58ZC_4/Screen%20shot%202010-10-05%20at%205.23.29%20PM.png" width="400" height="169" class="CGImage center" alt="Screen%20shot%202010-10-05%20at%205.23.2" /></a><br /><strong>Any ideas guys? I''m open to suggestions.</strong>', 'Scapehouse is boring --- Gathering some ideas for improvement and richness', '2010-10-12 16:24:55'),
