(788, 3, 'ΔH = H<sub>products</sub> – H<sub>reactants</sub><br />\n\n <br /><strong>Q1.</strong>\nWater vapor is formed form its gaseous elements and releases      <br />\n\n483.6 K.J.at constant pressure.<br />\n<ol>\n<li>List the elements\n needed for the formation of water vapor.\n\n\n\n\n\n</li> \n\n\n\n\n\n</ol>Hydrogen gasOxygen gas Write the thermo\n chemical reaction for the formation of water vapor. 2H2(g)\n + O2(g) --&gt; 2H2O + 483.6KJ\nWrite the thermo\n chemical reaction for the molar formation of water vapor. H2(g) +\n 1/2O2(g) --&gt; H2O + 241.8KJ\nGraph the given\n reaction.ΔH &lt; 0\n HP – HR\n HP &lt; HR Write the thermo\n chemical reaction including the value of ΔH. \nH2(g) +\n 1/2O2(g) --&gt; H2O     ΔHFormed\n = -241.8KJ/mol How many K.J are\n needed for the decomposition of water vapor into its elements, write the\n thermo chemical for this molar decomposition reaction. H2O --&gt; H2(g) + 1/2O2(g)        ΔH\n = +241.8KJ/mol', 'Chemistry worksheet 1', '2010-10-13 08:30:25'),
