(794, 3, 'The past 2 weeks have been great. We got lots of feedback and added some new features. However, I''ve noticed that many people are now saying that the site''s getting boring. Others keep on comparing Scapehouse to Facebook.<br /><br />First off, Scapehouse requires <em>participatio</em>n in order for you to enjoy it. Post stuff, fill out your profile, reply to others, and invite friends and help them get started. But if you just sign up and do nothing but browse, you might find it boring.<br /><br />Second, this site is in no way comparable to Facebook. Scapehouse is <em><strong>only 2 weeks</strong></em> old. Facebook is <strong><em>6 years</em></strong> old, with a 500 million strong user base, 1,000+ smart people working for them, and lots of cash and resources. Many people have asked us to add features like photo uploads. We have nothing against that, it''s just that we don''t have the resources we need (since we''re not really making any money yet).<br /><br /><a href="http://scapehouse.com/akay" target="_blank">Abdullah</a> and I are working as hard and as fast as we can to add new features to the site, but school isn''t really helping, and we''re having a hard time balancing the two.<br /><br />I appreciate your understanding.', 'A message to all our users', '2010-10-13 14:11:17'),
