(811, 1, 'To the optimist, the glass is half full. To the pessimist, the glass is half empty.To the engineer, the glass is twice as big as it needs.<br /><br />The <strong>BANKER </strong>would say that the glass has just under 50% of its net worth in liquid assets.<br />The <strong>GOVERNMENT </strong>would say that the glass is fuller than if the opposition party were in power.<br />The <strong>OPPOSITION </strong>would say that it is irrelevant because the present administration has changed the way such volume statistics are collected.<br />The <strong>ECONOMIST </strong>would say that, in real terms, the glass is 25% fuller than at the same time last year.<br />The <strong>PHILOSOPHER </strong>would say that, if the glass was in the forest and no one was there to see it, would it be half anything?<br />The <strong>PSYCHIATRIST </strong>would ask, “What did your mother say about the glass?”<br />The <strong>PHYSICIST </strong>would say that the volume of this cylinder is divided into two equal parts; one a colorless, odorless liquid, the other a colorless, odorless gas. Thus the cylinder is neither full nor empty. Rather, each half of the cylinder is full, one with a gas, one with a liquid.<br />The <strong>SEASONED DRINKER </strong>would say that the glass doesn’t have enough ice in it.<br />', 'Water in the glass....', '2010-10-13 17:04:08'),
