(832, 3, '\n<ol>\n<li>Open Notepad (or, create a new blank text-file)\n</li>\n<li>In the first line, type this: “.LOG” (without the quotes, and in UPPERcase)\n</li>\n<li>Save the document, and close it.\n</li>\n<li>Double-Click the Text file-icon to open the file again.<br />Notice how Notepad has added the time-stamp to a new line, awaiting your entry.\n</li>\n<li>Type something, save and close the document.<br />Each time you open the file, Notepad repeats the process, appending the time and date to the end of the file and placing the cursor below it.\n</li>\n</ol>(<a href="http://mintywhite.com/vista/notepad-work-log-oldschool-quicktip/" target="_blank">Original article</a>)<br />', 'Use Notepad as your Work Log [OldSchool-Quick-Tip]', '2010-10-14 15:59:19'),
