(1129, 3, '1) Briefly write about Japan’s form and location on the map?<br />- It’s made up of four islands. The landscape is mostly mountains<br />2) Name the four Islands that make up Japan?<br />- Hokkaido<br />- Honshu<br />- Shikoku<br />- Kyushu<br />3) List the bodies of water around Hokkaido.<br />On which island are the Japanese Alps located? What is the highest peak?<br />- Honshu<br />- Mt. Fuji<br />4) What is the smallest of the four Japanese islands? Name two major cities.<br />- Shikoku. It’s the smallest of the four main islands of Japan.<br />- Matsuyama and Takamatsu are the principal cities.<br />5) What is a subduction zone?<br />- An area where 2 tectonic plates meet<br />6) What are the two main natural disasters that always threaten Japan? Why?<br />- Earthquakes<br />- Tsunamis<br />7) Briefly compare the climate in the northern and southern Japan.<br />- The climate is humid  continental.<br />- Summers are cooled by Oyashio current from the North.<br />- Icy winds blowing off from Asian continent make winters cold.<br />- The windward sea of Japan coast experiences heavy  snowfall.', 'S.S. HW', '2010-11-03 12:17:39'),
