(1198, 3, 'Who were the AINU? How was their life affected by the Mongoloid?<br />- They were the first inhabitants of Japan and came from Central Asia.<br /><br /><br />Which Japanese culture traits resemble to the ones in Asian mainland?<br />- The Japanese language resembles Korean and Chinese.<br />- The major religion is Buddhism which came from China.<br />- Chinese ideas laid basis for Japan’s political systems.<br /><br /><br />What ancient religions are practiced in Japan? Which one is older?<br />- Buddhism<br /><br /><br />Identify: Shoguns and Samurai<br />- Shoguns were military rulers. Samurai were warriors who supported them.<br /><br /><br />What kept Asian invaders from ancient Japan?<br />- The power of the Shoguns.<br />- The island nature of Japan.<br /><br /><br />What European countries found their ways to Japan in 1500s? Why did the go there?<br />- Portuguese<br />- Spanish<br />- Dutch<br /><br /><br />How was the isolation period of China during 16 to 1800s pushed to an end?<br />- Merchants and other groups in Japanese society insisted for a greater contact with the world outside. <br /><br /><br />What forms of modernization took place in Japan?<br />- Rapid industrialization<br />- Changes in education<br />- Changes in law and government<br /><br /><br />What were some important reforms that happened in Japan, at the early 1890s?<br />- Japan had  a constitution and parliamentary system of government. <br />- Japan was recognized as a world power<br /><br /><br />Why is the agriculture in Japan so successful?<br />- Terraced cultivation<br />- New methods of farming.<br /><br /><br />Define: subsidies<br />- Financial support given by the government.', 'S.S. HW', '2010-11-10 10:55:48'),
