(1202, 3, 'An attractive blonde from Dublin arrived at the casino and bet twenty-thousand dollars on a single roll of the dice.<br /><br />She said, ''I hope you don''t mind, but I feel much luckier when I''m ''completely nude''.<br /><br />With that, she stripped from the neck down, rolled the dice and yelled,<br /><br />''Come on, baby, Mama needs new clothes!''<br /><br />As the dice came to a stop, she jumped up and down and squealed:<br /> <br /><br /><strong>''YES, YES, I WON, I WON!''</strong><br /><br /><br />She hugged each of the dealers and then picked up her winnings and her clothes and quickly departed.<br /> <br /><br />The dealers stared at each other dumbfounded.<br /><br />Finally, one of them asked, ''What did she roll?''<br /> <br /><br />The other answered, <strong>''I don''t know - I thought you were watching.''</strong><a target="_blank"><br /><br /><br /></a><strong>MORAL OF THE STORY:</strong><br />Not all Irish are stupid... Not all blondes are dumb, But all men are men.', '', '2010-11-10 15:47:33'),
