(1270, 3, 'If you''ve managed to understand the chain rule today, you can use it to help you check your answers for certain types of questions tomorrow. <br /><br /><strong>Example:</strong> f(x) = (x-2)<sup>2</sup><br />We have to use x + ∆x to find the answer (which, in this case, will be 2x - 4). You can then use the chain rule to check. You should get the same answer.<br /><br /><strong><u>CHECK (using the chain rule):</u></strong><br />2[(x - 2)] [1] = 2x - 4 :)', 'Tip for tomorrow''s quiz', '2010-11-21 13:39:35'),
