(1529, 3, 'Here''s a leaked pic of the next BlackBerry (bb) device: <br /><img src="http://www-bgr-com.vimg.net/wp-content/uploads/2011/01/Dakota.jpg" class="CGImage center" width="185" height="300" alt="Dakota.jpg" />Specs I managed to find:<br />\n<ul>\n<li>Quad-band GSM/GPRS/EDGE\n\n</li>\n<li>Tri-band UMTS\n\n</li>\n<li>5 megapixel camera with HD video recording, flash, and image stabilization\n\n</li>\n<li>4GB of built in storage, 768MB of RAM\n\n</li>\n<li>2.8-inch VGA 640×480 capacitive screen\n\n</li>\n<li>WiFi b,g,n on 2.4GHz and 5GHz frequencies\n\n</li>\n<li>3G mobile hotspot!\n\n</li>\n<li>MicroUSB port\n\n</li>\n<li>Bluetooth\n\n</li>\n<li>NFC\n\n</li>\n<li>Magnetometer\n\n</li>\n<li>Accelerometer\n\n</li>\n<li>Proximity sensor\n\n</li>\n<li>10.5mm thin\n\n</li>\n<li>Launches with BlackBerry OS 6.1\n\n</li>\n</ul>', 'BlackBerry Dakota', '2011-01-13 15:50:13'),
