(1533, 3, '<strong>iPad Keynote Superlatives</strong><br />\n<ul>\n<li><a href="http://www.youtube.com/watch?v=gHZzb42s3y4&amp;feature=player_embedded" target="_blank">http://www.youtube.com/watch?v=gHZzb42s3y4&amp;feature=player_embedded</a>\n\n</li>\n</ul>Language is a very powerful thing and Steve Jobs uses it particularly well during his keynote presentations.<br /><br /><strong>iPhone 4 Keynote Auto-Tuned</strong><br />\n<ul>\n<li><a href="http://www.youtube.com/watch?v=6aFKGFq79Cg&amp;feature=player_embedded" target="_blank"></a><a href="http://www.youtube.com/watch?v=6aFKGFq79Cg&amp;feature=player_embedded" target="_blank">http://www.youtube.com/watch?v=6aFKGFq79Cg&amp;feature=player_embedded</a>\n</li>\n</ul>“Jobs is closely involved in every detail of a presentation: writing descriptive taglines, creating slides, practicing demos and making sure the lighting is just right,” says Gallo. But live demos are risky, especially if you need to rely on a network connection to show off the product.<br />Although Jobs rarely makes a misstep on stage, the iPhone 4 keynote was blighted by connectivity issues. Because there were more than 500 Wi-Fi stations in the conference room, Jobs couldn’t get his iPhone 4 to reliably connect to a network.<br /><br /><strong>Boom!</strong><br />\n<ul>\n<li><a href="http://www.youtube.com/watch?v=r8L39UwOS-Y&amp;feature=player_embedded" target="_blank"></a><a href="http://www.youtube.com/watch?v=r8L39UwOS-Y&amp;feature=player_embedded" target="_blank">http://www.youtube.com/watch?v=r8L39UwOS-Y&amp;feature=player_embedded</a><br />\n</li>\n</ul>The Cambridge Dictionary of American English has three definitions for the word “boom,” although none of them match up with Jobs’s use of the word.<br /><br /><strong>Star Wars iPad Briefing</strong><br />\n<ul>\n<li><a href="http://www.youtube.com/watch?v=jbHF63b7g50&amp;feature=player_embedded" target="_blank"></a><a href="http://www.youtube.com/watch?v=jbHF63b7g50&amp;feature=player_embedded" target="_blank">http://www.youtube.com/watch?v=jbHF63b7g50&amp;feature=player_embedded</a><br />\n</li>\n</ul>This one''s for you @<a href="http://scapehouse.com/akay" target="_blank">AKay</a>. ;)', 'Steve Jobs Remixed', '2011-01-14 05:08:01'),
