(1, 117, 'Well, I have to say this vacation was an exciting one, full of fun and great new experiences.I enjoyed the train rides to Brussels and the journey under the English Channel to London. I enjoyed visiting the Apple Store for the first time in my life (we don''t have any of those here in Dubai). I enjoyed the ride back home on the A380.I got my iPad (64 GB, Wi-Fi + 3G) while I was in Paris. I also managed to get my hands on an iPhone 4, after waiting for hours in front of the Apple''s new Covent Garden store (which they claim is the largest Apple Store in the world). The iPad and iPhone 4 truly are fantastic pieces of hardware (and a work of art, I must say).', 'My Vacation | 2010'),
