(69, 194, 'Here is my reply to Ali''s email. Hopefully he''ll reply if I put it on a scape :DHey dude,it looks pretty good and I signed up as soon as I read the last word of your email. I''m pretty impressed; I did not know you knew PHP, AJAX, and Javascript! You have quite the list of language knowledge. The layout and feel of the website is just great. I like how it is nothing like Facebook, a little like twitter but with pictures and stuff! The only thing I would change is how the logo looks a bit like an open source community; rather then social and work related. Other then that a nice introduction and explanation would help "me" alot. I wasn''t really sure what a Scape was and whether I have a profile and a scape page or if it''s the same. Maybe a flash introduction or a video like  which explains  would work? (You could email that video or intro to people and have it on the front page so people know how it works before they sign up?)Also on the left panel where it says Control Panel maybe change that to settings? Just so that people are more familiar with the navigation since other sites usually go with settings.I''m sure you''ve put alot of work into this but I didn''t choose to say what you did good, simply because there was over 1,000 things that you''ve done right. I only found 3 things to question and that''s great. Keep up the good work. And thanks for telling me not to tell others, I was about to forward to my 300+ contacts that they should really look into this new service :DP.S. Maybe market this service as a "Fused" social network with hints of Facebook, Twitter, Myspace and even blogs seeing that you can add photos to posts.P.P.S. How is this website making you money? Where are the Ads!P.P.P.S. You should try out Digsby, it really is a good program.P.P.P.P.S. Smack a http://www.nowplaying.se/images/beta_icon.png icon on that baby and go ahead and tell people about it soon! Remember gMail had that icon on there for a year? ', ''),
