(90, 215, 'Here''s my plan for advertising this site whenever it''s ready for it.\n\nLink from my site\n\nLink from my facebook\n\nTell friends\n\nTell school\n\nTell parents\n\nTell parents friends\n\nEmail all contacts\n\nIf at least 5 people do that in a week it should bring in hell of users. Hopefully they continue to use this website and not abandon. @ALI, is there an option to get email notifications? It might make people come back if they see they have a message from a friend.', ''),
(91, 216, '@Ali@Abdullah  Hey I know this is going to seem pretty stupid. Or maybe even defeating the purpose of creating a social network. But would using http://bar.meebo.com/ be of any help?I know in the end you''d probably want people to use ScapeHouse for messages and chat. But in the real world people use at least 5 services. http://bar.meebo.com/ allows them to use Gmail Chat, Facebook Chat, AIM, Twitter, and Meebo right from your site. I personally use Facebook Chat, Gmail and Yahoo at the same time so I know it would work for "me".They can also drag content to their friends and their friends are linked straight to ScapeHouse. Bam tell them they need to make an account. I don''t know but I see alot of sites using this toolbar.', ''),
