(106, 231, '@aLi@AkAyHere is an idea. Don''t laugh. It may seem a little weird at first. But here goes.What if we were able to have web discussions? Why we need it:Because often discussions break into more branches. This happens on Facebook and in forums. Currently if different discussions branch you have to click see more comments to be blown with 20 replies to one comment. Let''s be realistic. If this happens with more then 4 people it''s IMPOSSIBLE to follow the convo.Google uses it for cool searching. So why not use it for convo? Let the user choose to create a web convo or convert one if things become to hectic. For simplicity have the web going down only so you don''t defeat the purpose of making it easier to follow.', '@AKAY\n@ALI'),
