(162, 300, 'Today, we''re adding a much-wanted feature: Direct messaging, in the form of notes. Introducing Noteboard Starting today, all profiles will have a new tab called "Noteboard". Clicking this tab will bring up an actual note board, where you can leave notes for another user to read. You can also leave notes on your own board for your own reference, or for others to see.Notes are intended to be short, and no more than 160 characters. Notes also come in different colors. You can choose your color just before you pin your note.Once you pin a note on someone''s board, that person will be notified that you left them a note. We will be adding more features to Noteboard later on. We hope you enjoy using it! :)', 'Hey, did you get my note?'),
