(263, 412, 'This post is more than a year old,but it has some valuable information that I composedThe greatest limitation that production artist face is governed by computing power, in the world of productions a single frame of animation can take hours to render and it eventually becomes a must for the user to upgrade to get their work done faster.The thing to note here is that fast workstations don’t come cheap which is why I took the time out to talk about some ways to get the fastest speeds for the lowest price’s, now before I get too far into talking about this, I would like to point out that I am mainly aiming this to intermediate users who have a basic understanding of the inner workings of a computer, otherwise what I am trying to explain might go right over your head in addition to that I am only talking about the computer its self the price estimates I will give are only that of the computer , monitors and other things are excluded.So before doing anything you have to analyze what your requirements are, this is indeed a very important step that many people don’t give attention to and later end up disappointed with their machine, as I was saying you first zero in on what you want and for that you have to look at what sort of work you are doing because if you specialize in one sort of job your requirements may vary greatly.3D Modelers:Coming to the point, everyone who only uses their applications for jobs such as 3D modeling and by modeling I mean multimillion polygon models, mainly more RAM and a fast GPU is required, because heavy models cost a lot of RAM to view in real time and in turn a fast GPU is needed to render it in the viewports, as for the CPU, priority should be given to less cores with more speed.3D Animators:If you are working on 3D animations the requirements are a bit different, the point here to note is that as long as your animation is still the GPU is utilized but as soon as you hit play your CPU is used, in order to maintain fluid playback, again a low core but high speed CPU is preferred. By core I am referring to the number of cores in products such as Core 2 Solo, Core 2 Duo, Core 2 Quad.Rendering:If you are doing jobs related to rendering and specifically 3D rendering or any type of simulation such a job that takes up a lot of CPU power and a lot of RAM and depending on what you are rendering or simulating you may or may not need a ton of Hard Drive storage, programs such as RealFlow and FumeFX take up a lot of HDD space and can peak over 100s of GBs, but in this case the GPU is not used and priority is given to a CPU with more cores and high total parallel processing power and off course lots of RAM, GPU is low priority since it''s not used in final rendering.Video Editors and Compositors:The preferred setup in this case would be low core high speed CPU and again a lot of RAM the GPU can be low priority as cheaper ones get the job done more or less without any trouble.My recommendations as of 2009:You can get really good workstations for under US$500, back in 2007 Intel released a mind blowing quad core processor the Q6600 which is still running strong, after which Intel released an entire line of 45nm processors and then an entirely new processor labeled i7, but the thing is that all those that came after Q66 only give an improvement of a few seconds in terms of rendering time, so I would say if you are on a budget and need raw rendering power, pickup a Core 2 Quad probably something like a Q8200 45nm chip.If you are an advanced user, an awesome way to save lots of money is by overclocking, all of Intel''s CPUs are made in a way that the fastest one on the product line is reduced in clock speed and is sold for a lower price, so basically if you overclock properly, you are paying for the lowest one on the line and enjoying the speed of the fastest one, and some chips even run stable at speeds faster than the top model, and with the new and improved architecture it means that you can over clock more and still get low temperature.RAM is now cheaper than ever, I would say stuff your system as much RAM as you can but be aware that anything more than 3GBs will not be detected by 32-Bit operating systems or 32-Bit applications, to utilize anything over 3.5GBs you need a 64-Bit operating system as well as a 64-Bit version of your application.ConclusionHere are some things to remember:\n\nYour GPU is only used inside the viewports of your application; they have no role in the actual final rendering or any simulation that you may conduct so buy one according to what you are doing.\n\n\n\n\nYour CPU is the most important component, but since most applications work on a single thread, that is, they only use 1 core out of the 2 , 4 or 8 that you may have, it is important to balance your core and GHz ratio depending on your needs, but at the end of the day a good quad core CPU will do you more good than a dual core in terms of speed and price, as support for quad core and octo core CPUs is rising.\n\n\n\n\nRAM can become the greatest limitation so get lots of it!\n\n\n\n\nHard disks are only important if you are going to be simulating large contents of data like particle systems or fluid simulations.\n\n\n\n\n--Abdullah', 'Affordable workstation for production | June, 2009'),
(264, 413, 'Zbrush a breakthrough indeed, developed by Pixologic it is a must have tool for any digital artist. Zbrush deals with 3D in a totally different perspective and is primarily used as a sculpting software application that allows artist to add mind-blowing amounts of detail to their models. ZBrush has a 2.5D environment it is not 2D and it is not 3D, it is based on pixols, a pixol is similar to a pixel but with the added property to depth, this amazing technology allows the software to handle models peaking at millions of polygons and still be able to give real time viewport feed back as the model is edited.The main limitation of that arises when using ZBrush is when you have edited your model and it''s time to take it to your 3D application for rendering, the meshes that are produced in ZBrush are so dense and heavy consisting of millions of polygons that the 3D application crashes 8 out of 10 times, to combat this limitation a technique called normal mapping is used, a map with all the depth and height information is calculated by ZBrush and spat out, the map can then be applied to a low res 3D model in the application and get a detail that was made it ZBrush without going through endless crashes. ZBrush is also used as a texturing application due to its powerful painting tool set, artist can texture their models in a way similar to coloring in a coloring book, ZBrush automatically makes a map for your model and that can be used for rendering later on.ZBrush has support for Wacom tablets and tablets from many other brands, if ZBrush is going to become a part of your workflow then I recommend that you use a tablet as it greatly increases the interactivity and productivity as it has support for pressure.Overall ZBrush is an extremely powerful application with powerful painting and sculpting features, but at it end of the day it is even more fun to use and play around with and my personal favorites.--Abdullah', 'Zbrush From Pixologic -- Software review | June, 2009'),
(265, 414, 'Vue is an advanced, feature rich but easy to use environment creation software, capable of rendering extremely realistic scenes, the way Vue manages environments is indeed a breakthrough, if Vue did not exist then realistic environment creation would still be one of the impossibilities in the field of CGI.The unique and efficient way that Vue manages environments is that they bring instancing into play, making it light on the RAM and increasing productivity, in fact this way is so powerful that Vue can render scenes over 50 billion polygons dense, Vue reduces the actual scene to an order of a few thousand polygons in the viewport and when you hit render it brings in the real meat and soul of the environment to life.Apart from polygons Vue has advanced in many other environmental effects such as volumetric and advanced light rendering, the water rendering that Vue is capable of is just beautiful, volumetric and spectral clouds add a ton of life to the scene and a lighting system that is aware of what time of day you are aiming the scene to be at, not to mention the extremely powerful Ecosystem feature that comes in Vue, that allows you to create very realistic, very dense and highly interactive foliage in your scene you can literally populate  forests with it.    Coming to the integration with your favorite 3D application, as of Vue 7 the integration of Vue in conjunction with 3dsmax and Maya has been improved dramatically and has actually become a lot more fun and productive to use, indeed a great upgrade from Vue 6, the integration that Vue 6 had or at least what they called it, was a good way to increase your stress, give you a headache and make your work slower and more painful all at wonderful price of over a 1000 bucks, since that is not the case anymore and Vue integrates into your workflow better than any other software out there, it now acts like a plug-in inside your application giving you all the creation tools without ever leaving the comfort of the native 3D application while at the same time utilizing Vue’s mind blowing rendering system.Once Vue’s world in integrated with the scene in your 3D application the results can be amazing, Vue uses the Mental Ray rendering engine that comes in Autodesk’s 3D applications, you can control and use lighting and shaders from your application as well as Vue and the best part is that you can populate forests and paint foliage using Vue’s Ecosystem without crashing your system, as the use of Ecosystem''s can lead to a scene as heavy as 10 billion or more polygons, all that can be rendered on a modest system so you won''t go bankrupt buying massive servers to get small jobs done.Vue is indeed a very powerful piece of software and one can’t disagree that it is in fact a breakthrough in the field of CGI.--Abdullah', 'e-on software , Vue 7 -- Software review | June, 2009'),
(266, 415, 'Some common questions that arise in the minds of almost every beginner looking to make a career in production:Where should I start? What application to use? And most importantly, what application is the best?Now as anyone who has experience in the fields of software and design would say, "There is no one answer to these questions" but what I will help you guys do is to zero in on what suits you guys the best by analyzing your requirements one by one.First and foremost I would like to clarify for you people what I mean by "Production", in the film and entertainment industry a production means the compilation of all the digital content and CGI (computer generated imagery) into a final product, what that product will be is totally up to you, that is if you are working on your own, otherwise such decisions are made by the director of the production studio but as long as that is not the case your are the director , the producer , you have full control over what you want to create and how you want to create.Coming to the question of "where to start?” Now to answer this you have to ask yourself a few quick questions, what section of the production pipeline are you aiming to make your career in, here are a few steps of the pipeline:· 3D Modeling· 3D Animation· 2D Animation· Compositing· Visual effects· Video editing· RenderingThis is a very rough sketch of the processes included in production but seeing this you can slim down the production process into 2 parts 3D and 2D , there are many more fields and sub fields that one can specialize in but for now this should get you going, I for one started out as a 3D Modeler and then over time I came across different programs, now if you are into the video editing and compositing side you will not have to deal with 3D at least not as much because in such a case all the video is shot from a real camera or is coming from the guys working in the 3D department , in any case the video is imported into software for refining, that is where you come in as a video editor, compositor or visual effects artist your job will be to add all the sauce and spices to the video, fix any issues and then render the final production.As for a person in the 3D side of production, his job is to model, texture, animate and render and send the raw rendered production to the compositors and video editors, depending on which sub field of 3D you wish to specialize in your jobs may be more or less.Coming to what application to use and which is better, this again varies from person to person, I personally prefer Autodesk and Adobe software for my work but there is so much out there in the market that a starter might find himself totally lost. For 3D we have countless software, 3ds Max, Maya, Cinema4D, LightWave, Hexagon, Modo, Blender, for 2D image and video editing and creation we have, Photoshop, Corel Draw, After Effects, Premiere, Sony Vegas, Combustion, Fusion , Digital Fusion and the list just goes on and on.Most people might say that Maya is better than 3ds Max, or After Effects is better than Digital Fusion and some might even say that if you want to go into the gaming industry you should chose 3dsmax and if you want to go in the Film industry you should chose Maya but let me tell you guys something even though 3ds Max is the most popular when it comes to gaming, at the end of the day you will find that both Maya and 3ds Max can achieve the same results in about the same time, this applies to all the other programs I have mentioned as well as the video editing software, it all goes down to what interface and layout suits you best, in some cases you might have to learn a software due to the requirements of the studio you are working in but once you have a solid hold on one software of its kind then the rest comes by its self, you will just have to familiarize yourself with the new buttons and procedures but it will not take you long to figure out everything because you will be aware how these things actually work under the hood.Content creation and production is an art in its self, very engaging, very interesting , and very rewarding, just the feeling of all your effort coming to life at render time is enough to keep you going on your path towards superiority in the field.--Abdullah', 'New to the world of production?'),
(267, 416, 'What is Autodesk 3ds Max? 3D Studio Max, 3ds Max or Max for short is a high end top of the line, industry standard 3D Production package developed by Autodesk with a full featured tool set offering you whatever you could possibly need for making amazing CGI, visualizations and animations.3ds Max is one of the most popular and most widely used 3D production packages used in the media industry, gaming industry, construction and architecture, visualizations and much more, ranging from top selling games to blockbuster movies. The beauty of 3ds Max is that it allows you to create very appealing content and very rewarding renders with just a little bit of experience with the software which all goes down to its streamlined easy to manage and highly organized and customizable interface. 3ds Max provides its users that very edge of control and power over their creations without, sucking the fun out of it, and without making the process complex and tedious thanks to its brilliant interface.Max has come a long way since its release back in 1990, with 12 releases from 1990 to 2009, Max is now more powerful and versatile than ever before now available in 2 version 32-bits which is limited to 4GBs of RAM and 64-bits allowing users to fully utilize their RAM and is expandable from 4GBs onwards, out of the box it offers 2 renderers, Max''s Default Scanline renderer and the high-end Mental Ray renderer (Discreet 3ds Max 6 and later) which is capable of expandability to up to unlimited processing cores, it offers advanced and powerful modeling tools for polygonal, NURBS, spline modeling. It has a very powerful rigging and animation system called Character Studio, and a highly capable physics simulator called Reactor, Max also offers users a particle system called PFlow or Particle Flow which is widely used in making mind blowing visual effects.If you ever feel limited by Max''s tool set and features, Max''s offers its users access to MAXScript the software''s own programming language that allows you to fiddle with the under-the-hood components of the software, allowing you to make your own tools, loops, algorithms, particle systems, the possibilities with MAXScript are practically endless the only limit is your imagination and creativity. And even if that is not enough to fulfill your production needs the market is full of low profile to high-end plug-ins that either work within Max''s interface or as an external program, some of the most popular ones are from Sitni Sati, they offer an advanced fluid simulator called FumeFX, and a widely used visual effects plug-in called AfterBurn which is used to make realistic explosions.For further details on the software visit Autodesk''s website--Abdullah', 'My productions application of choice -- Software review | June, 2009'),
