(276, 425, '\n\nBinding\nand Fusion: HIV begins its life cycle when it binds to a CD4 receptor and\none of two co-receptors on the surface of a CD4+ T-\nlymphocyte. The virus then fuses with the host cell. After fusion, the\nvirus releases RNA, its genetic material, into the host cell.\n\nReverse\nTranscription: An HIV enzyme called reverse transcriptase converts the single-\nstranded HIV RNA to double-stranded HIV DNA.\n\nIntegration: The newly formed HIV\nDNA enters the host cell''s nucleus, where an HIV enzyme called integrase\n"hides" the HIV DNA within the host cell''s own DNA. The integrated\nHIV DNA is called provirus. The provirus may remain inactive for several years,\nproducing few or no new copies of HIV.\n\nTranscription:\nWhen\nthe host cell receives a signal to become active, the provirus uses a host\nenzyme called RNA polymerase to create copies of the HIV genomic material, as\nwell as shorter strands of RNA called messenger RNA (mRNA). The mRNA is used as\na blueprint to make long chains of HIV proteins.\n\nAssembly: An HIV enzyme called\nprotease cuts the long chains of HIV proteins into smaller individual proteins.\nAs the smaller HIV proteins come together with copies of HIV''s RNA genetic\nmaterial, a new virus particle is assembled.\n\nBudding: The newly assembled\nvirus pushes out ("buds") from the host cell. During budding, the new\nvirus steals part of the cell''s outer envelope. This envelope, which acts as a\ncovering, is studded with protein/sugar combinations called HIV glycoproteins.\nThese HIV glycoproteins are necessary for the virus to bind CD4 and co-\nreceptors. The new copies of HIV can now move on to infect other cells.\n\nEnjoy. ;)', 'The HIV Life Cycle [BIO HW]'),
