(583, 777, 'I am really bored looking at the current timeline we have at the home page, we need more richness in it.Not every one publishes scapes and if they don''t there is just nothing going on to check out.I am looking forward to build new features like the Scapebox (tagging) etc but I feel its more important to make the core of the site more interactive and rich than adding more stuff that you can do to scapes, when the main thing is majority of the people are not publishing scapes.But what I have noticed is that they do at the very least reply/comment/like/dislike and watch other peopleKeeping in mind our current technical limitations (no chat please :) ) here are some things I thought of, that could add richness to the homepage.\n\nShow the a list of the new people getting watched by the people you watch, every now and then.\n\n\n\n\n\n\n\nSome way to bring up scapes that are getting a lot of attention, alot of likes/dislikes or replies.\n\n\n\n\n\n\n\n\nAdd a "ReScape" or "Share" option to share an interesting scape with your watchers, even if you your self have nothing to publish, lets say you want to share a homework scape.\n\n\n\n\n\nAn entry for change of profile pictures, lets say one of the people I watch changed their profile picture, like uploaded a new one, me and all the other people watching him will get informed of this with a timeline entry, although I am not sure if thats going to screw up privacy for some people because a lot of people can watch you.\n\n\n\n\n\n\nA tagged scape in the Scapebox or timeline:People being watched by the person you are watching:Any ideas guys? I''m open to suggestions.', 'Scapehouse is boring --- Gathering some ideas for improvement and richness'),
