(619, 816, 'I sent Ali an email exactly like this:Mahouk,I just wanted to tell you I am a  13 year old that is also interested in anything electronic related. I have been wanting to learn  programming language other then HTML, CSS, or XML. Any language that I try to learn, etc, Java, C++, I always lose the main point and don''t understand how it can all come together into a game or application. Can you explain that to me or give me resources? Other then boolean, functions, loops, and strings how can I actually call sprites, or images for applications slash games along with C++ to create something?Octavian-Thanks-- Untill you realize you are worthy of more, you will be content with less.and he responded exactly like this:Hi Octavian!I used to ask the same question. But once you start going deeper into the languages, it all becomes clear. Programming can be the most boring, the most difficult, &amp; the most tiring thing in the world, but it can also be the most profitable and the most rewarding. Keep this in mind, it will help keep you motivated and on track. Now, aside from knowing a language itself, you need to learn how to use something called an API (application programming interface). APIs differ from one operating system to another. On Windows, you use the Win32 API along with C++ to create applications and games (games on Windows also use a technology called DirectX, which gives them all those amazing graphics and effects). On the Mac, you use the Cocoa API along with Objective-C (the cool thing about this is that Cocoa is pretty much the same API used on the iPhone/iPod Touch, so if you can write applications on the Mac, you can easily write apps for the iPhone). On Linux you use the C programming language.If you''re aiming to become a hardcore programmer or to make your own games, C++ is the language of choice (I found this book very helpful. It''s written by the creator of C++ himself, and it explains those questions you asked about images in applications and games, etc.)If you''re aiming for portability, go with Java.If you want to write apps for the Mac and iPhone/iPod Touch, go with Objective-C (here''s a good book).If you just want to write simple but powerful programs, you can also use Visual Basic. It''s both easy and powerful.Besides books, you also have a beautiful invention called the Internet. Search online, ask questions in forums. You''ll find what you''re looking for eventually.If you still have any more questions (I hope I answered all of your questions up there), please don''t hesitate to ask. I''m always ready to help. :)And I replied exactly like this Ali,Thank you so much! I think everything you have told me is the best information I have come across in my 2-3 year computer knowledge hunger. Thank you so much for explaining what every language does and what it''s best used for. I knew of DirectX but I did not know of how Win API comes together with C++. It makes sense now, C++ is a data handler, API shows and orders graphic content yet which was loaded in with C++; correct? I will look into Visual Basic as well and see if it''s worth learning. I also knew about Cocoa API and iPod programming but sadly I do not have a mac, do you? Should I learn Win 32 API first or C++? And isn''t API C++ itself? Thanks again,And then we must have emailed and buzzed over 40 times. A few weeks ago he told me about ScapeHouse and here I am. By the way thanks for the help Ali I really appreciated it. Thanks for inviting me here too. I would probably be playing doing my homework right now if you never told me about ScapeHouse. Thanks for saving me :D', 'How me and Ali met on December nineteenth of 2009'),
