(914, 1129, '1) Briefly write about Japan’s form and location on the map?- It’s made up of four islands. The landscape is mostly mountains2) Name the four Islands that make up Japan?- Hokkaido- Honshu- Shikoku- Kyushu3) List the bodies of water around Hokkaido.On which island are the Japanese Alps located? What is the highest peak?- Honshu- Mt. Fuji4) What is the smallest of the four Japanese islands? Name two major cities.- Shikoku. It’s the smallest of the four main islands of Japan.- Matsuyama and Takamatsu are the principal cities.5) What is a subduction zone?- An area where 2 tectonic plates meet6) What are the two main natural disasters that always threaten Japan? Why?- Earthquakes- Tsunamis7) Briefly compare the climate in the northern and southern Japan.- The climate is humid  continental.- Summers are cooled by Oyashio current from the North.- Icy winds blowing off from Asian continent make winters cold.- The windward sea of Japan coast experiences heavy  snowfall.', 'S.S. HW'),
