(1179, 1394, 'Geography Revision: (Sorry if this is too late)This revision will be split into 2 parts.Part One: (This covers up Elements of Climate 1 &amp; 2)First I''ll begin with the definitions before getting to the notes.Definitions:\n\nAtmosphere: The sea of gases around the earth.\n\nWeather: The condition of the atmosphere at a certain place at one time.\n\nClimate: The general kinds of weather a certain place has over a long time.\n\nTemperature: The amount of heat found in the atmosphere.\n\nPrecipitation: The moisture that falls from the atmosphere onto the earth''s surface.\n\nInfrared radiation: The longer heat waves that were changed from short waves which were reflected into space.\n\nGreenhouse effect: The process in which gases in the lower atmosphere such as CO2 and Ozone take in some of the heat energy and keep it to warm earth.\n\nHumidity: When the amount of water vapor in the air is high.\n\nRelative Humidity: The amount of moisture in the air at a certain temperature compared to the amount the air can hold at that temperature.\n\nHurricanes: Fierce storms that form in low-latitude areas of the Atlantic Ocean and Caribbean Sea.\n\nTyphoons: Storms that have heavy rains and high winds and form in the Pacific Ocean and China Sea.\n\nAir pressure: The weight of the air''s pushing on earth''s surface.\n\nWind: What is caused from differences in air pressure.\n\nDoldrums: A calm region near the equator with little or no wind.\n\nTrade winds: The prevailing winds in low latitudes.\n\nPrevailing westerlies: Winds that blow from the west in middle latitudes.\n\nPolar easterlies: Winds that blow from the east in high latitudes.\n\nJet streams: Strong and narrow belts of wind high up in the air. They flow from west to east.\n\nThat''s it with definitions for Part 1. Now for the explanations:\n\nTwo gases, Nitrogen and Oxygen make up most of the earth''s atmosphere. Nitrogen takes up 78% of the atmosphere while Oxygen takes 21%. The remaining 1% is made up of other gases like Argon and CO2.\n\nThe atmosphere is the source of the earth''s weather and climate patterns. Heavy rains, strong winds, cool days and sunny skies all depend on the atmosphere and change from day to day all over the world.\n\nClimate is important to all life forms. Some life forms only live in certain climates, while others need to adapt in special ways.\n\nThe earth''s climate consists of 4 elements: Air pressure, Wind, Precipitation and Temperature.\n\nMost of you people did not quite understand what the greenhouse effect is, so I will try to clarify as much as I can.\n\nThe earth receives heat waves from the sun, which spread heat onto the soil and ocean water. Those waves are reflected back into space, only this time, they''re longer. Those longer and reflected waves don''t reflect back into space easily. This is because the greenhouse effect takes place. Meaning, CO2, Ozone and other gases are in some way, capturing some of the heat and keeping it on earth. The whole thing works like a greenhouse, that''s why it''s called the greenhouse effect.\n\nI hope you understood it a little better :)Moving on,\n\nScientists are worried that by burning coal, oil, natural gases and cutting trees, the earth''s natural greenhouse effect is changing.\n\nA lot of you didn''t understand this either, I''ll clarify ;)\n\nWhen we are burning coal, oil and natural gases, CO2 is being released into the air. When we are cutting trees, there wouldn''t be enough trees to consume the CO2 which means more CO2 is remaining in the atmosphere. That''s it. When there is too much CO2, this large amount of CO2 will keep large amounts of heat from those long waves that are reflected back to space. Which means the earth gets hotter since it keeps more heat. That''s what scientists are worried about.\n\nOkay, so what if the Earth becomes hotter? What happens then?\n\nThere are two major problems in allowing the earth to heat up. First of all, obviously we can''t survive in the hottest of temperatures. This doesn''t only effect humans, but a lot of other life forms too. The second reason is that if the earth becomes too hot, the polar ice caps will melt and will cause great and dangerous floods.\n\nMoving on:\n\nPrecipitation can fall onto earth''s surface in four different forms which are: Rain, snow, sleet and hail.\n\nThe atmosphere''s temperature can determine what sorts of precipitation will fall. For example, we''d see rain during warm weather, and snow during cold weather.\n\nMany people sometimes say it''s "muggy" when it''s really just humid. "Muggy" is not a scientific word. It''s just a word some people use these days.\n\nDifferences in air pressure will cause wind.\n\nThe uneven heating of the earth''s atmosphere indirectly leads to differences is air pressure, which then causes wind.\n\nHot air weighs less than cold air. This means that in hot areas (such as areas near the equator, you would find less air pressure. However, in the two poles, air pressure is high because the temperature is very cold.\n\nIf not for wind, the areas near the equator would be too cold and the areas near the poles would be too cold.\n\nPrevailing westerlies in the Northern Hemisphere blow from the Southwest to the northeast. But in the Southern Hemisphere they blow from the Northwest to the southeast.\n\nTrade winds in the Northern Hemisphere blow from the Northeast to the southwest. In the Southern Hemisphere, they blow from the Southeast to the northwest.\n\nPolar easterlies in the Northern Hemisphere blow from the Northeast to the southwest. In the Southern hemisphere, they blow from the southeast to the northwest.\n\nWind speeds in jet streams range between 75 mph and 280 mph.\n\nJet steams change positions from day to day and season to season.\n\nPart Two! (Lessons Controls on Climate 1 &amp; 2)Definitions:\n\nTemperate areas: Areas in the middle-latitudes that receive somewhat vertical rays part of the year and have temperatures that are not too hot and not too cold either.\n\nSeasons: Times of the year when different amounts of the sun''s heat reach earth.\n\nTropic of Cancer: 231/3 degrees north latitude line.\n\nSummer Solstice: June 22, a day that marks the longest period of daylight in the Northern Hemisphere during a year.\n\nArctic Circle: An imaginary line circling the earth at 66 1/2 degrees north latitude.\n\nAntarctic Circle: An imaginary line circling the earth at 66 1/2 degrees south latitude.\n\nFall Equinox: September 23, a time when days and nights in both hemispheres are of equal length.\n\nTropic of Capricorn: 23 1/2 degrees south latitude.\n\nWinter solstice: December 22, a day that marks the shortest period of daylight in the Northern Hemisphere and the longest in the Southern Hemisphere.\n\nSpring Equinox: March 21, a time when days and nights in both hemispheres are of equal length.\n\nSea breeze: During daytime, when the hot air over land rises, and the cold air over the sea takes the hot air''s place.\n\nLand breeze: During nighttime, when the hot air over the sea rises, and the cold air over the land comes and takes the hot air''s place.\n\nOrographic effect: The dropping of moisture as air moves up and over mountains. The air is cooled causing clouds and precipitation to fall.\n\nEffects of Altitude: As we go over sea level, temperature decreases. 1,000 feet up = 3 degrees Fahrenheit less.\n\nWindward: The side of the mountain which air is rising. It receives much rain or snow.\n\nLeeward: The side of the mountain that faces the direction the wind is blowing.\n\nFinally, no more definitions :PNow for the explanations:\n\nThe equator is typically hotter than other areas because the sun''s rays hit the equator more vertically than other latitudes.\n\nSeasons occur because of Earth''s tilt on its axis. This exposes the Northern and Southern hemispheres to the sun''s more vertical rays at different times of the year.\n\nWhen the northern hemisphere is tilted toward the sun, it''s summer there and winter in the area the sun can''t reach which is the southern hemisphere. The farthest the sun''s rays can reach is 23 1/2 degrees north latitude, which is a line called the Tropic of Cancer.\n\nSummer solstice is around June 22. It marks the longest period of daylight in the northern hemisphere in a year.\n\nDuring summer solstice, the sun never sets above the Arctic circle which is an imaginary line circling earth at 66 1/2 north latitude.\n\nAs earth spins around the sun, the period of daylight in the northern hemisphere becomes shorter overtime in winter.\n\nLand heats and cools more quickly than oceans and seas.\n\nSome lands are warmed by oceans. When land cools more quickly, the oceans and seas are hotter therefore warming the land. Other lands are cooled by oceans. Since land heats more quickly, the oceans and seas are colder therefore cooling the land.\n\nThe differences in heating and cooling of land and water create light winds, kind of like air pressure. We mentioned that hot air has less air pressure then cold air.\n\nAt night land looses heat and cools more quickly. During daytime the water looses heat and cools more quickly.\n\nWesterlies also effect climate. Areas to the west have milder winds that those a bit more to the east.\n\nOnce you''ve memorized all that ^, you really don''t need the book. Seriously. This is all you need to know. Hope this helped. Yes it''s long but very clear and informational. ;)', ''),
