(1318, 1533, 'iPad Keynote Superlatives\n\nhttp://www.youtube.com/watch?v=gHZzb42s3y4&amp;feature=player_embedded\n\n\nLanguage is a very powerful thing and Steve Jobs uses it particularly well during his keynote presentations.iPhone 4 Keynote Auto-Tuned\n\nhttp://www.youtube.com/watch?v=6aFKGFq79Cg&amp;feature=player_embedded\n\n“Jobs is closely involved in every detail of a presentation: writing descriptive taglines, creating slides, practicing demos and making sure the lighting is just right,” says Gallo. But live demos are risky, especially if you need to rely on a network connection to show off the product.Although Jobs rarely makes a misstep on stage, the iPhone 4 keynote was blighted by connectivity issues. Because there were more than 500 Wi-Fi stations in the conference room, Jobs couldn’t get his iPhone 4 to reliably connect to a network.Boom!\n\nhttp://www.youtube.com/watch?v=r8L39UwOS-Y&amp;feature=player_embedded\n\nThe Cambridge Dictionary of American English has three definitions for the word “boom,” although none of them match up with Jobs’s use of the word.Star Wars iPad Briefing\n\nhttp://www.youtube.com/watch?v=jbHF63b7g50&amp;feature=player_embedded\n\nThis one''s for you @AKay. ;)', 'Steve Jobs Remixed'),
